    <script>// Pandoc 2.9 adds attributes on both header and div. We remove the former (to
// be compatible with the behavior of Pandoc < 2.8).
document.addEventListener('DOMContentLoaded', function(e) {
  var hs = document.querySelectorAll("div.section[class*='level'] > :first-child");
  var i, h, a;
  for (i = 0; i < hs.length; i++) {
    h = hs[i];
    if (!/^h[1-6]$/i.test(h.tagName)) continue;  // it should be a header h1-h6
    a = h.attributes;
    while (a.length > 0) h.removeAttribute(a[0].name);
  }
});
</script>

# Probabilit

---
# Le distribuzioni di probabilit in R

Ci sono tantissime distribuzioni implementate in R, e molte altre caricando specifici pacchetti. `t`, `norm`, `gamma`, `beta`, `poisson`, `exp`, `chisq`, `binom`, ...

--

Tutte queste distribuzioni possono essere combinate con 4 funzioni: `r`, `q`, `d` e `p`:

- `rnorm`: genera numeri da una distribuzione normale (molto utile per simulare dati)
- `dnorm`: calcola la densit di probabilit
- `pnorm`: calcola la probabilit cumulata dato un quantile
- `qnorm`: calcola il quantile data la probabilit cumulata

---
# Distribuzione Normale - `rnorm`


```r
par(mfrow = c(1,3))
d1 &lt;- rnorm(n = 1000, mean = 100, sd = 5)
d2 &lt;- rnorm(n = 1000, mean = 100, sd = 10)
d3 &lt;- rnorm(n = 1000, mean = 100, sd = 50)
hist(d1, xlim = c(100-3*50, 100+3*50))
hist(d2, col = &quot;lightblue&quot;, xlim = c(100-3*50, 100+3*50))
hist(d3, col = &quot;salmon&quot;, xlim = c(100-3*50, 100+3*50))
```

&lt;img src=&quot;data:image/png;base64,#lezione3_files/figure-html/unnamed-chunk-1-1.svg&quot; width=&quot;100%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

---
# Distribuzione Normale - `pnorm`

Usiamo una la funzione `plot_pnorm` per rappresentare `pnorm()`


```r
plot_pnorm(q = 0.5, mean = 0, sd = 1, lower.tail = TRUE) # pnorm(0.5, 0, 1, TRUE)
```

&lt;img src=&quot;data:image/png;base64,#lezione3_files/figure-html/unnamed-chunk-2-1.svg&quot; width=&quot;60%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

---
# Distribuzione Normale - `pnorm`

Possiamo anche rappresentare il complementare


```r
plot_pnorm(q = 0.5, mean = 0, sd = 1, lower.tail = FALSE) # pnorm(0.5, 0, 1, FALSE)
```

&lt;img src=&quot;data:image/png;base64,#lezione3_files/figure-html/unnamed-chunk-3-1.svg&quot; width=&quot;60%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

---
# Distribuzione Normale - `pnorm`

Possiamo anche avere un&#39;area delimitata da 2 quantili


```r
plot_pnorm(q = c(-1, 1), mean = 0, sd = 1) # pnorm(1, 0, 1) - pnorm(-1, 0, 1)
```

&lt;img src=&quot;data:image/png;base64,#lezione3_files/figure-html/unnamed-chunk-4-1.svg&quot; width=&quot;60%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

---
# Distribuzione Normale - `qnorm`

`qnorm`  l&#39;operazione complementare di `pnorm`. Se vogliamo sapere il quantile associato ad una certa probabilit comulata `\(p\)` facciamo `qnorm(p, mean, sd)`


```r
p &lt;- 0.2
q &lt;- round(qnorm(p, 0, 1), 3)
plot_pnorm(q = q, mean = 0, sd = 1) +
  geom_vline(xintercept = qnorm(p, 0, 1), color = &quot;red&quot;)
```

&lt;img src=&quot;data:image/png;base64,#lezione3_files/figure-html/unnamed-chunk-5-1.svg&quot; width=&quot;60%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

---
# Distribuzione Normale - `dnorm`

Con `dnorm` calcoliamo la densit di probabilit di un quantile. In termini pratici corrisponde all&#39;asse `\(y\)` dei nostri grafici:


```r
q &lt;- 0.5
dnorm(q, 0, 1)
```

```
## [1] 0.3520653
```

```r
plot_pnorm(q = q, mean = 0, sd = 1) +
  geom_point(x = q, y = dnorm(q, 0, 1), size = 3, col = &quot;red&quot;)
```

&lt;img src=&quot;data:image/png;base64,#lezione3_files/figure-html/unnamed-chunk-6-1.svg&quot; width=&quot;60%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

# Esercizi 

---
# Esercizi 

Supponiamo che il punteggio X di un test sullansia segua una distribuzione normale con:

- media `\(\mu = 50\)`
- deviazione standard `\(\sigma = 6\)`


```r
plot_pnorm(mean = 50, sd = 6)
```

&lt;img src=&quot;data:image/png;base64,#lezione3_files/figure-html/unnamed-chunk-7-1.svg&quot; width=&quot;60%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

---
# Esercizi 

Calcolare la probabilit che un soggetto scelto a caso abbia un punteggio:

1. inferiore a 45
2. superiore a 60
3. compreso tra 55 e 65
4. inferiore alla media meno una deviazione standard
5. superiore alla media pi una deviazione standard

---
# Soluzioni


```r
mu &lt;- 50
sigma &lt;- 6
```


```r
pnorm(45, mu, sigma)
```

```
## [1] 0.2023284
```

```r

# Esercizi 

Calcolare la probabilit che un soggetto scelto a caso abbia un punteggio che non si
discosta dalla media pi di

6. una deviazione standard
7. 2 deviazioni standard
8. deviazioni standard

Calcolare

9. il 95-esimo percentile della distribuzione dei punteggi
10. il rango percentile associato a un soggetto che ha ottenuto un punteggio di 43

b &lt;- mu + sigma
pnorm(b, mean=mu, sd=sigma) - pnorm(a, mean=mu, sd=sigma)

# Punti Z

Calcoliamo i punti z rispetto ai valori normativi con `\(z_i = \frac{x_i - \mu}{\sigma}\)`:


```r
datz$yz &lt;- (datz$y - mu)/sigma

La logica  leggermente diversa rispetto ai grafici di base. Con `ggplot` si compongono i grafici a *strati* concatenando con `+`

plot(mtcars$mpg, mtcars$disp)

# ggplot2

Ma la potenza di `ggplot` si vede nella semplicit nel creare grafici complessi. Prendiamo i dati della lezione precedente:


```r
dat &lt;- read.csv(&quot;../../data/psych.csv&quot;, header = TRUE, sep = &quot;;&quot;) # importare
dat &lt;- dat[complete.cases(dat), ]
```

Facciamo uno `scatterplot` della relazione tra `eta` e `depressione` per ogni `diagnosi` colorando in base al `ses`:


```r
ggplot(dat, aes(x = eta, y = dep_score, color = ses)) +
  geom_point() +
  facet_wrap(~diagnosi)
```

    var sheets = document.styleSheets, node;
    for (var i = 0; i < sheets.length; i++) {

    tr.querySelectorAll('td:first-child .key').forEach(key => {
      const k = key.innerText;
      if (/^[a-z]$/.test(k)) res[k] = t;  // must be a single letter (key)

(function() {

  if (!scripts.length) return;
  for (var i = 0; i < scripts.length; i++) {
    var s = document.createElement('script');
    var code = document.createTextNode(scripts[i].textContent);
    s.appendChild(code);
    var scriptAttrs = scripts[i].attributes;
    for (var j = 0; j < scriptAttrs.length; j++) {

// adds .remark-code-has-line-highlighted class to <pre> parent elements
// of code chunks containing highlighted lines with class .remark-code-line-highlighted
(function(d) {
  const hlines = d.querySelectorAll('.remark-code-line-highlighted');
  const preParents = [];
  const findPreParent = function(line, p = 0) {
    if (p > 1) return null; // traverse up no further than grandparent
    const el = line.parentElement;
    return el.tagName === "PRE" ? el : findPreParent(el, ++p);
  };

  for (let line of hlines) {
    let pre = findPreParent(line);
